// MakeScanOpt 
func MakeScanOpt() *container.AppTabs {

	opts := GetOpts("poc")

	var optTypes = container.NewAppTabs()
	var appItems []*container.TabItem
	var appItem *container.TabItem

	for _, opt := range opts {
		var typeCon = container.NewVBox()
		for _, application := range opt.applications {
			var typeCheck *widget.Check
			var lin = widget.NewSeparator()
			var optCon = container.New(layout.NewGridLayout(3))
			var leakChecks []*widget.Check
			for i, leakName := range application.leakNames {
				var leakCheck *widget.Check
				leakCheck = widget.NewCheck(leakName, func(value bool) {
					if leakCheck.Checked {
						OptLeak = append(OptLeak, leakCheck.Text)
					} else {
						for index, l := range OptLeak {
							if l == leakCheck.Text {
								OptLeak = append(OptLeak[:index], OptLeak[index+1:]...)
							}
						}
					}
				})
				leakChecks = append(leakChecks, leakCheck)
				optCon.Add(leakChecks[i])
			}
			typeCheck = widget.NewCheck(application.appName, func(value bool) {
				if typeCheck.Checked {
					for _, leak := range leakChecks {
						leak.SetChecked(true)
					}
				} else {
					for _, leak := range leakChecks {
						leak.SetChecked(false)
					}
				}
			})

			typeCon.Add(typeCheck)
			typeCon.Add(optCon)
			typeCon.Add(lin)
		}
		scroll := container.NewScroll(typeCon)
		appItem = container.NewTabItem(opt.optType, scroll)
		appItems = append(appItems, appItem)
	}
	optTypes.SetItems(appItems)
	return optTypes
}

